import { combineReducers } from 'redux';

import payerReducer from './payerReducer';
import recipientReducer from './recipientReducer';
import incomeReducer from './incomeReducer';
import taxYearReducer from './taxYearReducer';
import emailReducer from './emailReducer';

import payerErrorReducer from './payerErrorReducer';
import recipientErrorReducer from './recipientErrorReducer';
import emailErrorReducer from './emailErrorReducer';
import incomeErrorReducer from './incomeErrorReducer';


const rootReducer =  combineReducers({
  taxYear: taxYearReducer,
  payer: payerReducer,
  recipient: recipientReducer,
  income: incomeReducer,
  email: emailReducer,

  payerErrors: payerErrorReducer,
  recipientErrors: recipientErrorReducer,
  incomeErrors: incomeErrorReducer,
  emailErrors: emailErrorReducer
});

export default rootReducer;
